import React, { Component } from "react";
import styled from "styled-components";
import "../App.css";

export default class Navbar extends Component {
  render() {
    return (
      // <nav class="navbar navbar-expand-sm bg-light navbar-light px-sm-5">
      //   <ul class="navbar-nav align-items-center">
      //     <li>
      //       <span class="fas fa-home"> Home </span>
      //     </li>
      //     <li>
      //       <span class="fas fa-bolt"> Moments</span>
      //     </li>
      //     <li>
      //       <span class="far fa-bell"> Notifications </span>
      //     </li>
      //     <li>
      //       <span class="far fa-envelope"> Messages</span>
      //     </li>
      //   </ul>
      //   <TweetButton class="ml-auto">Tweet </TweetButton>
      // </nav>

      <nav class="navbar navbar-light navbar-expand-sm bg-light justify-content-between">
        <ul class="navbar-nav align-items-center">
          <li>
            <span class="fas fa-home"> Home </span>
          </li>
          <li>
            <span class="fas fa-bolt"> Moments</span>
          </li>
          <li>
            <span class="far fa-bell"> Notifications </span>
          </li>
          <li>
            <span class="far fa-envelope"> Messages</span>
          </li>
        </ul>
        <TweetButton class="btn btn-outline-success my-2 my-sm-0" type="submit">
          tweet
        </TweetButton>
      </nav>
    );
  }
}

const TweetButton = styled.button`
  text-transform: capitalize;
  padding: 6px 16px;
  border-radius: 100px;
  color: white;
  background-color: #1da1f2;
  float: right;
  &:focus {
    border-radius: 100px;
    border-color: #1da1f2;
  }
`;
